(function () {
  // Your web app's Firebase configuration, get it from your firebase project settings page on the General tab.
  const firebaseConfig = {
    apiKey: "AIzaSyALhCa_EKCRlCJy12g8_LjdSPHWo3YM9Hk",
    authDomain: "auth-abe41.firebaseapp.com",
    projectId: "auth-abe41",
    storageBucket: "auth-abe41.appspot.com",
    messagingSenderId: "1016256369209",
    appId: "1:1016256369209:web:484748123eb9403934f3e8",
  };
  // Initialize Firebase
  // firebase.initializeApp(firebaseConfig);
  const app = initializeApp(firebaseConfig);
  // Initialize Firebase Authentication and get a reference to the service
  const auth = getAuth(app);

  // TODO: initialize provider for google auth
  const provider = new GoogleAuthProvider();
})();


function Firstsection() {
  return (
    <div className="firstsection">
      <header className="firstsection-header">
      <p>Welcome to your professional community</p>
      </header>
      <body>
      <button className='loginbutton' id="googlelogin">Continue with Google</button>
